      SELECT DISTINCT + COUNT ( * ) * - - ( + COUNT ( * ) ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q8605.out
    data: |
      81
